import React, { useState } from "react";
import Header from "../partials/Header"
import Search from "../search/Search";

function New(){

   const [text,setText]=useState()

    function handleSearch(){
       setWText(setText)
    }

    return <div>
            <Header />
            <Search onAdd={handleSearch} />
           </div>
}

export default New;
